import "./dashbb.css";

export default function Dashbb() {
  return (
    <div className="dashbb-g">
      <div className="row-md">
        {/* <div className="column"> */}
          <div className="book">
            <ul>
              <li>The Hunter's shadow <p className="purchase-count">Sold: 20</p></li>
              <li>The Hunter's shadow <p className="purchase-count">Sold: 20</p></li>
              <li>The Hunter's shadow <p className="purchase-count">Sold: 20</p></li>
              <li>The Hunter's shadow <p className="purchase-count">Sold: 20</p></li>
            </ul>
          </div>
        {/* </div> */}
      </div>
    </div>
  );
}
